import "./App.css";
import { useEffect } from "react";
import Form from "./Form";
import Form2 from "./Form2";
import Form3 from "./Form3";

function App() {
  // You can skip useEffect if you're not using TailwindCSS
  // Otherwise, for the production usage refer to https://tailwindcss.com/docs/installation
  useEffect(() => {
    if (document) {
      const stylesheet = document.createElement("link");
      stylesheet.rel = "stylesheet";
      stylesheet.href = "https://unpkg.com/tailwindcss@^2/dist/tailwind.min.css";

      document.head.appendChild(stylesheet);
    }
  }, []);

  return (
    <div className="flex items-center justify-center space-x-8 h-screen w-screen">
      <Form />
      <Form2 />
      <Form3 />
    </div>
  );
}

export default App;
